<!-- 商品ページ買い物かご注意書き -->
<style type="text/css">
<!--
.itemcart_ShoppingGuide {
	font-family:メイリオ;
    font-size: 12px;
    width: 100%;
    margin: 8px auto;
}
.itemcart_ShoppingGuide h3 {
    margin: 0;
    padding: 4px 8px;
}
.itemcart_ShoppingGuide ul {
    padding: 8px;
    margin: 0;
    list-style: none;
}
.itemcart_ShoppingGuide a {
    font-size: 13px;
    text-decoration: none;
    transition: all .2s ease;
}
.itemcart_ShoppingGuide p {
    color: #888;
    margin: 0;
}

/*design-1  ----------------------*/
.itemcart_ShoppingGuide.design1 {
    border: 1px solid #999;
}
.itemcart_ShoppingGuide.design1 h3 {
    color: #fff;
    background: #999;
}
.itemcart_ShoppingGuide.design1 li {
    display: inline-block;
    margin: 0 4px 8px 0;
}
.itemcart_ShoppingGuide.design1 li a {
    font-weight: bold;
    color: #fff;
    display: inline-block;
    padding: 8px 12px;
    background: #bf0000;
    border: 1px solid #bf0000;
    border-radius: 3px;
}
.itemcart_ShoppingGuide.design1 li a:hover {
    color: #bf0000;
    background: #fff;
    border-color: #bf0000;
}
.itemcart_ShoppingGuide.design1 p {
    padding: 8px;
}

/*design-2  ----------------------*/
.itemcart_ShoppingGuide.design2 {
    color: #333;
}
.itemcart_ShoppingGuide.design2 h3 {
    border-left: 4px solid;
}
.itemcart_ShoppingGuide.design2 ul {
    padding: 1px 0 0 5px;
    box-sizing: border-box;
}
.itemcart_ShoppingGuide.design2 li {
    display: inline-block;
    width: 33%;
    margin: -1px 0 0 -5px;
    border: 1px solid;
    text-align: center;
    box-sizing: border-box;
}
.itemcart_ShoppingGuide.design2 li a {
    color: #333;
    font-size: 11px;
    width: 100%;
    display: inline-block;
    padding: 8px;
    box-sizing: border-box;
}
.itemcart_ShoppingGuide.design2 li a span {
    font-size: 16px;
    font-weight: bold;
    display: block;
}
.itemcart_ShoppingGuide.design2 li a:hover {
    color: #fff;
    background: #333;
}
.itemcart_ShoppingGuide.design2 p {
    padding: 8px 0;
}

/*design-3  ----------------------*/
.itemcart_ShoppingGuide.design3 {
    color: #0075C1;
    background: #f1f1f1;
}
.itemcart_ShoppingGuide.design3 h3 {
    background: #0075C1;
    text-align: center;
    color: #fff;
}
.itemcart_ShoppingGuide.design3 ul {
    padding: 8px 0 0 4px;
}
.itemcart_ShoppingGuide.design3 li {
    width: 32%;
    display: inline-block;
    margin: 0 2px 4px 0 ;
}
.itemcart_ShoppingGuide.design3 li a {
    color: #0075C1;
    font-size: 11px;
    display: inline-block;
    width: 100%;
    box-sizing: border-box;
    background: #FAE625;
    border-radius: 4%;
    text-align: center;
    padding: 16px;
}
.itemcart_ShoppingGuide.design3 li a span {
    font-size: 16px;
    font-weight: bold;
    display: block;
}
.itemcart_ShoppingGuide.design3 li a:hover {
    color: #fff;
    background: #0075C1;
}
.itemcart_ShoppingGuide.design3 p {
    padding: 8px;
}

-->
